import React, { Component } from "react";
import { Switch, Route, Redirect, withRouter } from "react-router-dom";
import { observer } from "mobx-react";

// Components
//import Loading from "./components/Loading";
import SchoolList from "./components/SchoolList";
import SubjectList from "./components/SchoolList/CategoryList/SubjectList";
import CategoryList from "./components/SchoolList/CategoryList";
import Login from "./components/Login";
import Signup from "./components/Signup";

// Store

class App extends Component {
  // const getView = () => {
  // if (authorStore.loading {/*|| bookStore.loading*/}) {

  // if (authStore.loading) {
  //   return <Loading />;
  // } else {

  render() {
    return (
      <Switch>
        <Redirect exact from="/" to="/schoollist" />
        <Route path="/login/" component={Login} />
        <Route path="/schools/" component={SchoolList} />
        <Route path="/schools/categories/subjects/" component={SubjectList} />
        <Route path="/schools/categories/" component={CategoryList} />
        {/* <Route path="/books/:bookColor?" component={BookList} /> */}
        <Route path="/signup/" component={Signup} />
        {/* <Route path="/profile/:profileID" component={Profile} /> */}
      </Switch>
    );
  }
}
export default withRouter(observer(App));
